pub struct Solution {}
impl Solution {
    pub fn product_except_self(nums: Vec<i32>) -> Vec<i32> {
        let mut result: Vec<i32> = vec![0; nums.len()];

        let sum_product = nums.iter().filter(|&n| n != &0).fold(1, |product, a| product * a);

        let zero_left = nums.iter().position(|&n| n == 0);
        let zero_right = nums.iter().rposition(|&n| n == 0);

        for i in 0..nums.len() {
            if nums[i] != 0 {
                if zero_left == None {
                    result[i] = sum_product/nums[i];
                } else {
                    result[i] = 0;
                }
            } else {
                if zero_right != Some(i) || zero_left != Some(i) {
                    result[i] = 0;
                } else {
                    result[i] = sum_product;
                }
            }
        }

        return result;
    }
}
